eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"default\": () => (__WEBPACK_DEFAULT_EXPORT__)\n/* harmony export */ });\nconst instruments = [\n// =========== instruments =====\n//strings\n[{\n  name: \"guitar\",\n  nameRU: \"гитара\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/guitar.mp3 */ \"./src/assets/sounds/guitar.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/guitar.png */ \"./src/assets/images/guitar.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/guitar-color.png */ \"./src/assets/images/guitar-color.png\"),\n  descript: \"The guitar is a fretted musical instrument that typically has six strings. It is usually held flat against the player's body and played by strumming or plucking the strings with the dominant hand, while simultaneously pressing selected strings against frets with the fingers of the opposite hand.\",\n  descriptRU: \"Гитара — это ладовый музыкальный инструмент, который обычно имеет шесть струн. Применяется в качестве аккомпанирующего или сольного инструмента во многих стилях и направлениях музыки, среди которых романс, блюз, кантри, фламенко, рок, джаз. Изобретённая в XX веке электрическая гитара произвела значительные изменения в музыке и тем самым оказала сильное влияние на массовую культуру.\"\n}, {\n  name: \"balalaika\",\n  nameRU: \"балалайка\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/balalaika.mp3 */ \"./src/assets/sounds/balalaika.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/balalaika.png */ \"./src/assets/images/balalaika.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/balalaika-color.png */ \"./src/assets/images/balalaika-color.png\"),\n  descript: \"The balalaika is a stringed musical instrument with a characteristic triangular wooden, hollow body, fretted neck and three strings. Two strings are usually tuned to the same note and the third string is a perfect fourth higher. The higher-pitched balalaikas are used to play melodies and chords. The instrument generally has a short sustain, necessitating rapid strumming or plucking when it is used to play melodies.\",\n  descriptRU: \"Балала́йка — русский, белорусский и украинский народный струнный щипковый музыкальный инструмент с треугольной или овальной формы корпусом, имеющий от двух до шести струн. Характерными приёмами звукоизвлечения являются бряцание и тремоло — удары указательным пальцем по всем струнам одновременно.\"\n}, {\n  name: \"gusli\",\n  nameRU: \"гусли\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/gusli.mp3 */ \"./src/assets/sounds/gusli.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/gusli.png */ \"./src/assets/images/gusli.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/gusli-color.png */ \"./src/assets/images/gusli-color.png\"),\n  descript: \"The balalaika is a stringed musical instrument with a characteristic triangular wooden, hollow body, fretted neck and three strings. Two strings are usually tuned to the same note and the third string is a perfect fourth higher. The higher-pitched balalaikas are used to play melodies and chords. The instrument generally has a short sustain, necessitating rapid strumming or plucking when it is used to play melodies.\",\n  descriptRU: \"Гусли — русский народный струнный щипковый музыкальный инструмент, в общем виде представляющий собой резонаторный корпус с натянутыми над ним 5—20 струнами, образующими диатонический звукоряд. Относятся к семейству цитр, гусли с игровым окном — к лирам.\"\n}, {\n  name: \"harp\",\n  nameRU: \"арфа\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/harp.mp3 */ \"./src/assets/sounds/harp.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/harp.png */ \"./src/assets/images/harp.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/harp-color.png */ \"./src/assets/images/harp-color.png\"),\n  descript: \"The harp is a stringed musical instrument that has a number of individual strings running at an angle to its soundboard; the strings are plucked with the fingers. Harps can be made and played in various ways, standing or sitting and in orchestras or concerts. Its most common form is triangular in shape and made of wood. Some have multiple rows of strings and pedal attachments.\",\n  descriptRU: \"Арфа - струнный щипковый музыкальный инструмент, состоит из двух расположенных под углом рам, между которыми натянуто множество струн. Один из древнейших инструментов, символ Ирландии. В XVIII столетии была изобретена педальная арфа, ставшая стандартом в классической музыке.\"\n}, {\n  name: \"violin\",\n  nameRU: \"скрипка\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/violin.mp3 */ \"./src/assets/sounds/violin.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/violin.png */ \"./src/assets/images/violin.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/violin-color.png */ \"./src/assets/images/violin-color.png\"),\n  descript: \"The violin, sometimes known as a fiddle, is a wooden chordophone (string instrument) in the violin family. Most violins have a hollow wooden body. It is the smallest and thus highest-pitched instrument (soprano) in the family in regular use.\",\n  descriptRU: \"Скрипка — смычковый музыкальный инструмент с четырьмя струнами, настроенными по квинтам: Gм D1 A1 E2. Самая высокая регистровая разновидность скрипичного семейства, ниже которой располагаются альт, виолончель и контрабас.\"\n}, {\n  name: \"cello\",\n  nameRU: \"виолончель\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/cello.mp3 */ \"./src/assets/sounds/cello.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/cello.png */ \"./src/assets/images/cello.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/cello-color.png */ \"./src/assets/images/cello-color.png\"),\n  descript: \"The cello or violoncello is a bowed (sometimes plucked and occasionally hit) string instrument of the violin family. Its four strings are usually tuned in perfect fifths: from low to high, C2, G2, D3 and A3. The viola's four strings are each an octave higher. Music for the cello is generally written in the bass clef, with tenor clef, or alto clef, and treble clef used for higher-range passages.\",\n  descriptRU: \"Виолонче́ль — смычковый музыкальный инструмент с 4-мя струнами, настроенными по квинтам: Cб Gб Dм Aм. По высоте звучания занимает промежуточное положение между более высоким альтом и низким контрабасом.\"\n}],\n//wind\n[{\n  name: \"flute\",\n  nameRU: \"флейта\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/flute.mp3 */ \"./src/assets/sounds/flute.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/flute.png */ \"./src/assets/images/flute.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/flute-color.png */ \"./src/assets/images/flute-color.png\"),\n  descript: \"The flute is a family of classical music instrument in the woodwind group. Like all woodwinds, flutes are aerophones, meaning they make sound by vibrating a column of air. However, unlike woodwind instruments with reeds, a flute is a reedless wind instrument that produces its sound from the flow of air across an opening.\",\n  descriptRU: \"Флейта — лабиальный духовой музыкальный инструмент, в котором первичным источником колебаний является воздушная струя, рассекающаяся о край стенки инструмента, называемого ла́биум (лат. labium — губа). Источник колебаний приводит в движение воздушный столб в канале флейты и образуется звук определённой высоты. Один из древнейших музыкальных инструментов. Относится к группе деревянных духовых.\"\n}, {\n  name: \"saxophone\",\n  nameRU: \"саксофон\",\n  // TODO change maybe\n  mp3: __webpack_require__(/*! ./../../assets/sounds/saxophone.mp3 */ \"./src/assets/sounds/saxophone.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/saxophone.png */ \"./src/assets/images/saxophone.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/saxophone-color.png */ \"./src/assets/images/saxophone-color.png\"),\n  descript: \"The saxophone (referred to colloquially as the sax) is a type of single-reed woodwind instrument with a conical body, usually made of brass. As with all single-reed instruments, sound is produced when a reed on a mouthpiece vibrates to produce a sound wave inside the instrument's body.\",\n  descriptRU: \"Саксофон — тростевой духовой музыкальный инструмент, по принципу звукоизвлечения принадлежащий к семейству язычковых деревянных духовых музыкальных инструментов. Семейство саксофонов сконструировано в 1842 году бельгийским музыкальным мастером Адольфом Саксом и запатентовано им четыре года спустя. С середины XIX века саксофон используется в духовом оркестре, реже — в симфоническом, также в качестве солирующего инструмента в сопровождении оркестра (ансамбля). Является одним из основных инструментов джаза и родственных ему жанров, а также эстрадной музыки. Инструмент обладает полным и мощным звучанием, певучим тембром и большой технической подвижностью.\"\n}, {\n  name: \"french horn\",\n  nameRU: \"волторна\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/horn.mp3 */ \"./src/assets/sounds/horn.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/horn.png */ \"./src/assets/images/horn.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/horn-color.png */ \"./src/assets/images/horn-color.png\"),\n  descript: \"A horn (or french horn) is any of a family of musical instruments made of a tube, usually made of metal and often curved in various ways, with one narrow end into which the musician blows, and a wide end from which sound emerges. In horns, unlike some other brass instruments such as the trumpet, the bore gradually increases in width through most of its length—that is to say, it is conical rather than cylindrical.\",\n  descriptRU: \"Валторна — медный духовой музыкальный инструмент тенорового регистра. Произошла от охотничьего сигнального рога, в оркестр вошла в середине XVII века. До 1830-х годов, подобно другим медным инструментам, не имела вентилей и была натуральным инструментом с ограниченным звукорядом (так называемая «натуральная валторна», которую использовали ещё в классической и барочной музыке, в том числе Бах, Моцарт, Бетховен).\"\n}, {\n  name: \"trumpet\",\n  nameRU: \"труба\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/trumpet.mp3 */ \"./src/assets/sounds/trumpet.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/trumpet.png */ \"./src/assets/images/trumpet.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/trumpet-color.png */ \"./src/assets/images/trumpet-color.png\"),\n  descript: \"The trumpet is a brass instrument commonly used in classical and jazz ensembles. The trumpet group ranges from the piccolo trumpet—with the highest register in the brass family—to the bass trumpet, pitched one octave below the standard B♭ or C trumpet.\",\n  descriptRU: \"Труба — медный духовой музыкальный инструмент альтово-сопранового регистра, самый высокий по звучанию среди медных духовых. С древнейших времён натуральная труба использовалась в качестве сигнального инструмента, примерно с XVII века вошла в состав оркестра. С изобретением механизма вентилей труба получила полный хроматический звукоряд и с середины XIX века стала полноценным инструментом классической музыки. Обладает ярким, блестящим тембром, используется как сольный инструмент или в симфоническом и духовом оркестрах, а также в джазе и других жанрах.\"\n}, {\n  name: \"bagpipes\",\n  nameRU: \"волынка\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/bagpipes.mp3 */ \"./src/assets/sounds/bagpipes.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/bagpipes.png */ \"./src/assets/images/bagpipes.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/bagpipes-color.png */ \"./src/assets/images/bagpipes-color.png\"),\n  descript: \"Bagpipes are a woodwind instrument using enclosed reeds fed from a constant reservoir of air in the form of a bag. The Scottish Great Highland bagpipes are the best known examples in the Anglophone world, but people have played bagpipes for centuries throughout large parts of Europe, Northern Africa, Western Asia, around the Persian Gulf and northern parts of South Asia.The term bagpipe is equally correct in the singular or the plural, though pipers usually refer to the bagpipes as \\\"the pipes\\\", \\\"a set of pipes\\\" or \\\"a stand of pipes\\\"\",\n  descriptRU: \"Волынка — традиционный музыкальный духовой язычковый инструмент многих народов Европы. В Шотландии — главный национальный инструмент. Представляет собой мешок, который обыкновенно делается из воловьей, телячьей или козьей шкуры, снятой целиком, в виде бурдюка, зашитой наглухо и снабжённой сверху трубкой для наполнения меха воздухом, с прикреплёнными снизу одной, двумя или тремя игральными язычковыми трубами, клавишами и ступками, служащими для создания многоголосия.\"\n}, {\n  name: \"organ\",\n  nameRU: \"орган\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/organ.mp3 */ \"./src/assets/sounds/organ.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/organ.png */ \"./src/assets/images/organ.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/organ-color.png */ \"./src/assets/images/organ-color.png\"),\n  descript: \"The organ is a keyboard instrument of one or more pipe divisions or other means for producing tones, each played from its own manual, with the hands, or pedalboard, with the feet.\",\n  descriptRU: \"Орган — клавишный духовой музыкальный инструмент. Большие концертные органы превосходят по габаритам все прочие музыкальные инструменты. Основу конструкции органа составляют духовые трубы разной длины и диаметра, устройство для нагнетания воздуха, пульт с клавиатурами, трактура. Звуковое своеобразие органа определяют специфические тембры («регистры»), набор которых индивидуален для каждого инструмента. Оформ­ле­ние кор­пу­са (большого акустического) органа иногда пред­став­ля­ет не мень­шую ху­дожественную цен­ность, чем его зву­ча­ние.\"\n}],\n//keyboards \n[{\n  name: \"piano\",\n  nameRU: \"фортепиано\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/piano.mp3 */ \"./src/assets/sounds/piano.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/piano.png */ \"./src/assets/images/piano.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/piano-color.png */ \"./src/assets/images/piano-color.png\"),\n  descript: \"The piano is a stringed keyboard instrument in which the strings are struck by wooden hammers that are coated with a softer material. It is played using a keyboard, which is a row of keys (small levers) that the performer presses down or strikes with the fingers and thumbs of both hands to cause the hammers to strike the strings. It was invented in Italy by Bartolomeo Cristofori around the year 1700.\",\n  descriptRU: \"Фортепиано — клавишный струнный инструмент с горизонтальным (рояль) или вертикальным (пианино) расположением струн. На звучание фортепиано большое влияние оказывает его конструкция, с XVIII в. претерпевшая значительные изменения. Фортепиано состоит из акустического аппарата (резонансная дека, струнная одежда), клавишного механизма, опорных конструкций (футор, металлическая рама, вирбельбанк). Сложная система рычагов механизма позволяет передать усилие от играющего через клавишу к молоточку, удар которого по струне производит звук. Современный диапазон фортепиано — 71⁄4 октав (88 клавиш).\"\n}, {\n  name: \"accordion\",\n  nameRU: \"аккордеон\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/accordion.mp3 */ \"./src/assets/sounds/accordion.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/accordion.png */ \"./src/assets/images/accordion.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/accordion-color.png */ \"./src/assets/images/accordion-color.png\"),\n  descript: \"The saxophone (referred to colloquially as the sax) is a type of single-reed woodwind instrument with a conical body, usually made of brass. As with all single-reed instruments, sound is produced when a reed on a mouthpiece vibrates to produce a sound wave inside the instrument's body.\",\n  descriptRU: \"Аккордеон — хроматическая ручная гармоника с клавиатурой мелодии фортепианного (наиболее часто) типа. Клавиатура аккомпанемента такая же как у баяна: с 5—6 рядами кнопок, звучащими басами и аккордами (готовый аккордеон) или отдельными нотами (выборный или готово-выборный аккордеон).\"\n}, {\n  name: \"synthesizer\",\n  nameRU: \"синтезатор\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/synthesizer.mp3 */ \"./src/assets/sounds/synthesizer.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/synthesizer.png */ \"./src/assets/images/synthesizer.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/synthesizer-color.png */ \"./src/assets/images/synthesizer-color.png\"),\n  descript: \"A synthesizer is an electronic musical instrument that generates audio signals. Synthesizers typically create sounds by generating waveforms through methods including subtractive synthesis, additive synthesis and frequency modulation synthesis. These sounds may be altered by components such as filters, which cut or boost frequencies; envelopes, which control articulation, or how notes begin and end; and low-frequency oscillators, which modulate parameters such as pitch, volume, or filter characteristics affecting timbre. Synthesizers are typically played with keyboards or controlled by sequencers, software or other instruments, and may be synchronized to other equipment via MIDI.\",\n  descriptRU: \"Синтезатор — электронный клавишный музыкальный инструмент. В зависимости от способа генерации звуковых волн и их преобразования синтез звука можно классифицировать следующим образом: суммирующий, вычитающий, операторный, физический, сэплерный, волновой, гибритный. С развитием микроэлектроники начиная с конца 1970-х годов выпускаются простейшие синтезаторы как в виде отдельных инструментов, так и являющиеся составной частью других устройств, например, калькуляторов. Такие синтезаторы обычно позволяют воспроизводить только один тон одновременно.\"\n}, {\n  name: \"harpsichord\",\n  nameRU: \"клавесин\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/harpsichord.mp3 */ \"./src/assets/sounds/harpsichord.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/harpsichord.png */ \"./src/assets/images/harpsichord.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/harpsichord-color.png */ \"./src/assets/images/harpsichord-color.png\"),\n  descript: \"The trumpet is a brass instrument commonly used in classical and jazz ensembles. The trumpet group ranges from the piccolo trumpet—with the highest register in the brass family—to the bass trumpet, pitched one octave below the standard B♭ or C trumpet.\",\n  descriptRU: \"Клавесин — клавишный струнный музыкальный инструмент с щипковым способом звукоизвлечения. Музыканта, исполняющего произведения на клавесине и его разновидностях, называют клавесини́стом. Звук клавесина — блестящий, но мало певучий, отрывистый, не поддающийся динамическим изменениям[3], то есть плавное увеличение и уменьшение громкости на клавесине невозможно. Тем не менее, разнообразных динамических эффектов можно добиться, умело управляя количеством и скоростью взятия звуков, взаимодействием с резонансом.\"\n}, {\n  name: \"button accordion\",\n  nameRU: \"баян\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/button-accordion.mp3 */ \"./src/assets/sounds/button-accordion.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/button-accordion.png */ \"./src/assets/images/button-accordion.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/button-accordion-color.png */ \"./src/assets/images/button-accordion-color.png\"),\n  descript: \"A chromatic button accordion is a type of button accordion where the melody-side keyboard consists of rows of buttons arranged chromatically. The bass-side keyboard is usually the Stradella system or one of the various free-bass systems. Included among chromatic button accordions are the Russian bayan and Schrammel accordion. There can be 3 to 5 rows of vertical treble buttons. In a 5 row chromatic, two additional rows repeat the first 2 rows to facilitate options in fingering.\",\n  descriptRU: \"Баян — русская хроматическая ручная гармоника имеющая от 3 и более рядов круглых кнопок на клавиатуре мелодии и 5—6 рядов кнопок на клавиатуре аккомпанемента, клавиши которого звучат басами и аккордами (готовый аккомпанемент) или отдельными нотами (выборный или готово-выборный аккомпанемент).Современные баяны выпускают с двумя основными видами правой клавиатуры: трёхрядные и пятирядные. В пятирядной клавиатуре ряды 2 и 1 (считая от меха) являются вспомогательными, они дублируют ноты 5-го и 4-го рядов соответственно. Баян входит в состав оркестра русских народных инструментов.\"\n}, {\n  name: \"celesta\",\n  nameRU: \"челеста\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/celesta.mp3 */ \"./src/assets/sounds/celesta.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/celesta.png */ \"./src/assets/images/celesta.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/celesta-color.png */ \"./src/assets/images/celesta-color.png\"),\n  descript: \"The celesta, also called a bell-piano, is a struck idiophone operated by a keyboard. It looks similar to an upright piano (four- or five-octave), albeit with smaller keys and a much smaller cabinet, or a large wooden music box (three-octave). The keys connect to hammers that strike a graduated set of metal (usually steel) plates or bars suspended over wooden resonators. Four- or five-octave models usually have a damper pedal that sustains or damps the sound. The three-octave instruments do not have a pedal because of their small \\\"table-top\\\" design. One of the best-known works that uses the celesta is Pyotr Ilyich Tchaikovsky's \\\"Dance of the Sugar Plum Fairy\\\" from The Nutcracker.\",\n  descriptRU: \"Челеста — клавишный металлофон, по технике игры и внешне напоминающий небольшое пианино или фисгармонию. Ударный музыкальный инструмент, звучащим телом которого являются стальные пластинки. Челеста нашла применение не только как академический инструмент, но используется и в джазе, рок-музыке, других направлениях популярной музыки. В 1930-е годы Фэтс Уоллер иногда играл на челесте правой рукой и одновременно на фортепиано левой.\"\n}],\n//other\n[{\n  name: \"xylophone\",\n  nameRU: \"ксилофон\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/xylophone.mp3 */ \"./src/assets/sounds/xylophone.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/xylophone.png */ \"./src/assets/images/xylophone.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/xylophone-color.png */ \"./src/assets/images/xylophone-color.png\"),\n  descript: \"The xylophone   is a musical instrument in the percussion family that consists of wooden bars struck by mallets. Like the glockenspiel (which uses metal bars), the xylophone essentially consists of a set of tuned wooden keys arranged in the fashion of the keyboard of a piano.\",\n  descriptRU: \"Ксилофон — ударный музыкальный инструмент с определённой высотой звучания. Представляет собой ряд деревянных брусков разной величины, настроенных на определённые ноты. По брускам ударяют палочками с шарообразными наконечниками (малетами) или специальными молоточками, похожими на небольшие ложки. Диапазон современного ксилофона составляет 3,5 октавы.\"\n}, {\n  name: \"drums\",\n  nameRU: \"барабаны\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/drums.mp3 */ \"./src/assets/sounds/drums.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/drums.png */ \"./src/assets/images/drums.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/drums-color.png */ \"./src/assets/images/drums-color.png\"),\n  descript: \"The drum is a member of the percussion group of musical instruments. In the Hornbostel-Sachs classification system, it is a membranophone. Drums consist of at least one membrane, called a drumhead or drum skin, that is stretched over a shell and struck, either directly with the player's hands, or with a percussion mallet, to produce sound.\",\n  descriptRU: \"Барабан — музыкальный инструмент из семейства ударных. Типичным представителем является мембранный барабан, состоящий из полого корпуса-резонатора определённой формы или рамы, на которую натянута кожаная или пластиковая мембрана. Её натяжением регулируется относительная высота звука. Звук извлекают ударом по мембране деревянной колотушкой с мягким наконечником, палочкой, щётками, руками, а иногда и трением.\"\n}, {\n  name: \"triangle\",\n  nameRU: \"треугольник\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/triangle.mp3 */ \"./src/assets/sounds/triangle.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/triangle.png */ \"./src/assets/images/triangle.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/triangle-color.png */ \"./src/assets/images/triangle-color.png\"),\n  descript: \"The triangle is a musical instrument in the percussion family, and is classified as an idiophone in the Hornbostel-Sachs classification system. Triangles are made from a variety of metals. The metal is formed into a triangle shape by bending or casting methods. The instrument is usually held by a loop of some form of thread or wire at the top curve.\",\n  descriptRU: \"Треугольник — ударный музыкальный инструмент в виде металлического прута (обычно из стали или алюминия), изогнутого в форме треугольника. Один из углов оставлен открытым (концы прута почти касаются). Треугольник принадлежит к инструментам с неопределённой высотой звука, имеет блестящий и яркий тембр, способный украсить даже мощное оркестровое тутти. Треугольник подвешивается за один из углов на тонкой проволоке или тесьме, которую держат в руке или прикрепляют к пюпитру. По треугольнику ударяют металлической (реже деревянной) палочкой (на жаргоне музыкантов эта палочка называется «гвоздь»).\"\n}, {\n  name: \"maracas\",\n  nameRU: \"мараки\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/maracas.mp3 */ \"./src/assets/sounds/maracas.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/maracas.png */ \"./src/assets/images/maracas.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/maracas-color.png */ \"./src/assets/images/maracas-color.png\"),\n  descript: \"A maracas, sometimes called shaker or chac-chac, is a rattle which appears in many genres of Caribbean and Latin music. It is shaken by a handle and usually played as part of a pair.\",\n  descriptRU: \"Марака — древнейший ударно-шумовой инструмент коренных жителей Антильских островов — индейцев таино, разновидность погремушки, издающей при потряхивании характерный шуршащий звук. В настоящее время мараки популярны на всей территории Латинской Америки и являются одним из символов латиноамериканской музыки. Как правило, музыкант, играющий на мараках, использует пару погремушек — по одной в каждой руке.\"\n}, {\n  name: \"vargan\",\n  nameRU: \"варган\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/vargan.mp3 */ \"./src/assets/sounds/vargan.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/vargan.png */ \"./src/assets/images/vargan.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/vargan-color.png */ \"./src/assets/images/vargan-color.png\"),\n  descript: \"The vargan is a lamellophone instrument, consisting of a flexible metal or bamboo tongue or reed attached to a frame. Contrary to the name, the harp originated in Mongolia and has no relation to the Jewish people. Vargan may be categorized as idioglot or heteroglot (whether or not the frame and the tine are one piece); by the shape of the frame (rod or plaque); by the number of tines, and whether the tines are plucked, joint-tapped, or string-pulled.\",\n  descriptRU: \"Варган — музыкальный инструмент в виде свободно колеблющегося в проёме рамки язычка, приводимого в движение пальцем или дёрганием за нитку. Инструмент устанавливают в области рта. Ротовая полость и глотка, а также носовая полость и нижние дыхательные пути служат резонатором, усиливающим громкость. Управляя работой артикуляционного аппарата и дыхания, изменяют тембр звучания варгана за счёт усиления тех или иных обертонов в его звуковом спектре, при этом основной тон звучит постоянным бурдоном.\"\n}, {\n  name: \"timpani\",\n  nameRU: \"литавры\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/timpani.mp3 */ \"./src/assets/sounds/timpani.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/timpani.png */ \"./src/assets/images/timpani.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/timpani-color.png */ \"./src/assets/images/timpani-color.png\"),\n  descript: \"Timpani are musical instruments in the percussion family. A type of drum categorised as a hemispherical drum, they consist of a membrane called a head stretched over a large bowl traditionally made of copper. Thus timpani are an example of kettle drums, also known as vessel drums and semispherical drums, whose body is similar to a section of a sphere whose cut conforms the head. Most modern timpani are pedal timpani and can be tuned quickly and accurately to specific pitches by skilled players through the use of a movable foot-pedal. \",\n  descriptRU: \"Литавры — ударный музыкальный инструмент с определённой высотой звучания. Литавры представляют собой систему от двух до семи металлических котлообразных чаш, открытая сторона которых затянута кожей или пластиком, а нижняя часть может иметь отверстие. На литаврах возможно достичь огромных градаций звука — от едва слышного пианиссимо до оглушительного фортиссимо. Среди особых эффектов — приглушённое звучание литавр, покрытых кусками мягкого сукна.\"\n}],\n// =========== end instruments =====\n// =========== composers ===========\n// fisrt\n[{\n  name: \"vivaldi\",\n  nameRU: \"вивальди\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/vivaldi.mp3 */ \"./src/assets/sounds/vivaldi.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/vivaldi.png */ \"./src/assets/images/vivaldi.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/vivaldi-color.png */ \"./src/assets/images/vivaldi-color.png\"),\n  descript: \"Antonio Lucio Vivaldi (1678 - 1741) was an Italian composer, virtuoso violinist and impresario of Baroque music. Regarded as one of the greatest Baroque composers, Vivaldi's influence during his lifetime was widespread across Europe, giving origin to many imitators and admirers. He pioneered many developments in orchestration, violin technique and programatic music.[5] He consolidated the emerging concerto form into a widely accepted and followed idiom, which was paramount in the development of Johann Sebastian Bach's instrumental music.\",\n  descriptRU: \"Антонио Лучо Вивальди (1678 - 1741) — итальянский композитор и скрипач-виртуоз, педагог, дирижёр, католический священник. Оставил огромное и разнообразное композиторское наследие: оперы, оратории, инструментальная и камерная музыка. При жизни получил широкое признание как скрипач во всей Европе. Известность Вивальди как композитора при его жизни была велика, но после смерти его слава начала затухать. Одними из наиболее известных его работ являются четыре скрипичных концерта «Времена года», входящие в состав цикла «Спор гармонии с изобретением».\"\n}, {\n  name: \"bach\",\n  nameRU: \"бах\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/bach.mp3 */ \"./src/assets/sounds/bach.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/bach.png */ \"./src/assets/images/bach.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/bach-color.png */ \"./src/assets/images/bach-color.png\"),\n  descript: \"Johann Sebastian Bach (1685 - 1750) was a German composer and musician of the late Baroque period. He is known for his orchestral music such as the Brandenburg Concertos; instrumental compositions such as the Cello Suites; keyboard works such as the Goldberg Variations and The Well-Tempered Clavier; organ works such as the Schubler Chorales and the Toccata and Fugue in D minor; and vocal music such as the St Matthew Passion and the Mass in B minor. Since the 19th-century Bach revival he has been generally regarded as one of the greatest composers in the history of Western music.\",\n  descriptRU: \"Иоганн Себастьян Бах (1685 - 1750) — немецкий композитор, органист, капельмейстер, музыкальный педагог. Автор более 1000 музыкальных произведений во всех значимых жанрах своего времени (кроме оперы). Творческое наследие Баха интерпретируется как обобщение музыкального искусства барокко. Убеждённый протестант, Бах написал много духовной музыки. Его Страсти по Матфею, Месса h-moll, кантаты, инструментальные обработки протестантских хоралов — признанные шедевры мировой музыкальной классики. Бах известен как великий мастер полифонии, в его творчестве барочная полифония достигла наивысшего расцвета.\"\n}, {\n  name: \"haydn\",\n  nameRU: \"гайдн\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/haydn.mp3 */ \"./src/assets/sounds/haydn.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/haydn.png */ \"./src/assets/images/haydn.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/haydn-color.png */ \"./src/assets/images/haydn-color.png\"),\n  descript: \"Franz Joseph Haydn (1732 - 1809) was an Austrian composer of the Classical period. He was instrumental in the development of chamber music such as the string quartet and piano trio. His contributions to musical form have led him to be called \\\"Father of the Symphony\\\" and \\\"Father of the String Quartet\\\". Haydn spent much of his career as a court musician for the wealthy Esterházy family at their Eszterháza Castle. Until the later part of his life, this isolated him from other composers and trends in music so that he was, as he put it, \\\"forced to become original\\\". Yet his music circulated widely, and for much of his career he was the most celebrated composer in Europe.\",\n  descriptRU: \"Франц Йозеф Гайдн (1732 - 1809) — австрийский композитор, представитель венской классической школы, один из основоположников таких музыкальных жанров, как симфония и струнный квартет, также внес вклад в такой жанр, как сонаты для клавира. Создатель мелодии, впоследствии лёгшей в основу гимнов Германии и Австро-Венгрии. Сын каретного мастера.\"\n}, {\n  name: \"beethoven\",\n  nameRU: \"бетховен\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/beethoven.mp3 */ \"./src/assets/sounds/beethoven.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/beethoven.png */ \"./src/assets/images/beethoven.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/beethoven-color.png */ \"./src/assets/images/beethoven-color.png\"),\n  descript: \"Ludwig van Beethoven (1770 – 1827) was a German composer and pianist. Beethoven remains one of the most admired composers in the history of Western music; his works rank amongst the most performed of the classical music repertoire and span the transition from the Classical period to the Romantic era in classical music. His career has conventionally been divided into early, middle, and late periods. His early period, during which he forged his craft, is typically considered to have lasted until 1802. From 1802 to around 1812, his middle period showed an individual development from the styles of Joseph Haydn and Wolfgang Amadeus Mozart, and is sometimes characterized as heroic. During this time, he began to grow increasingly deaf. In his late period, from 1812 to 1827, he extended his innovations in musical form and expression.\",\n  descriptRU: \"Людвиг ван Бетховен (1770 – 1827) — немецкий композитор, пианист и дирижёр, последний представитель «венской классической школы». Бетховен — ключевая фигура классической музыки в период между классицизмом и романтизмом, один из наиболее исполняемых композиторов в мире. Он писал во всех существовавших в его время жанрах, включая оперу, музыку к драматическим спектаклям, хоровые сочинения. Самыми значительными в его наследии считаются инструментальные произведения: фортепианные, скрипичные и виолончельные сонаты, концерты для фортепиано, для скрипки, квартеты, увертюры, симфонии. Творчество Бетховена оказало значительное воздействие на симфонизм XIX и XX веков.\"\n}, {\n  name: \"ogiński\",\n  nameRU: \"огинский\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/ogiński.mp3 */ \"./src/assets/sounds/ogiński.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/ogiński.png */ \"./src/assets/images/ogiński.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/ogiński-color.png */ \"./src/assets/images/ogiński-color.png\"),\n  descript: \"Michał Kleofas Ogiński (1765 – 1833) was a Polish diplomat and politician, Grand Treasurer of Lithuania, and a senator of Tsar Alexander I. He was also a composer of early Romantic music.\",\n  descriptRU: \"Князь Михаил Клеофас Огинский (1765 — 1833) — польский композитор-любитель, дипломат, политический деятель Речи Посполитой и Российской империи, один из лидеров восстания Костюшко, почётный член Виленского университета, член Правительствующего Сената, автор знаменитого «Полонеза Огинского».\"\n}, {\n  name: \"mozart\",\n  nameRU: \"моцарт\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/mozart.mp3 */ \"./src/assets/sounds/mozart.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/mozart.png */ \"./src/assets/images/mozart.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/mozart-color.png */ \"./src/assets/images/mozart-color.png\"),\n  descript: \"Wolfgang Amadeus Mozart (1756 — 1791), baptised as Joannes Chrysostomus Wolfgangus Theophilus Mozart, was a prolific and influential composer of the Classical period. Despite his short life, his rapid pace of composition resulted in more than 800 works of virtually every genre of his time. Many of these compositions are acknowledged as pinnacles of the symphonic, concertante, chamber, operatic, and choral repertoire. Mozart is widely regarded as among the greatest composers in the history of Western music, with his music admired for its \\\"melodic beauty, its formal elegance and its richness of harmony and texture\\\".\",\n  descriptRU: \"Вольфганг Амадй Моцарт (1756 — 1791) — выдающийся австрийский композитор и музыкант-виртуоз. Один из самых популярных классических композиторов, Моцарт оказал большое влияние на мировую музыкальную культуру. По свидетельству современников, Моцарт обладал феноменальным музыкальным слухом, памятью и способностью к импровизации. Самый молодой член Болонской филармонической академии (с 1770 года) за всю её историю, а также самый молодой кавалер ордена Золотой шпоры (1770).\"\n}],\n// second\n[{\n  name: \"paganini\",\n  nameRU: \"паганини\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/paganini.mp3 */ \"./src/assets/sounds/paganini.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/paganini.png */ \"./src/assets/images/paganini.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/paganini-color.png */ \"./src/assets/images/paganini-color.png\"),\n  descript: \"Niccolo Paganini (1782 - 1840) was an Italian violinist and composer. He was the most celebrated violin virtuoso of his time, and left his mark as one of the pillars of modern violin technique. His 24 Caprices for Solo Violin Op. 1 are among the best known of his compositions and have served as an inspiration for many prominent composers.\",\n  descriptRU: \"Никколо Паганини (1782 - 1840) — итальянский скрипач-виртуоз, композитор. Непревзойденный успех Паганини лежал не только в глубоком музыкальном даровании этого артиста, но и в необычайной технике, в безукоризненной чистоте, с которой он исполнял труднейшие пассажи, и в новых горизонтах скрипичной техники, открытых им. Паганини был настоящим виртуозом, обладавшим в высшей степени яркой индивидуальностью, основывая свою игру на оригинальных технических приёмах, которые он исполнял с непогрешимой чистотой и уверенностью.\"\n}, {\n  name: \"alyabyev\",\n  nameRU: \"алябьев\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/alyabyev.mp3 */ \"./src/assets/sounds/alyabyev.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/alyabyev.png */ \"./src/assets/images/alyabyev.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/alyabyev-color.png */ \"./src/assets/images/alyabyev-color.png\"),\n  descript: \"Alexander Aleksandrovich Alyabyev (1787 — 1851) , also rendered as Alabiev or Alabieff, was a Russian composer known as one of the fathers of the Russian art song. He wrote seven operas, twenty musical comedies, a symphony, three string quartets, more than 200 songs, and many other pieces.\",\n  descriptRU: \"Александр Александрович Алябьев (1787 — 1851) — русский композитор, пианист, дирижёр. В XIX веке пользовался большим успехом, написал около 200 романсов, 6 опер, 20 музыкальных комедий, множество других музыкальных произведений. Среди лучших произведений Алябьева — романсы «Соловей» (1826) на слова А. А. Дельвига, «Зимняя дорога», «Два ворона» на стихи Пушкина, «Вечерний звон» на слова И. Козлова, «Нищая» на стихи П. Беранже в переводе Дмитрия Ленского.\"\n}, {\n  name: \"strauss\",\n  nameRU: \"штраус\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/strauss.mp3 */ \"./src/assets/sounds/strauss.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/strauss.png */ \"./src/assets/images/strauss.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/strauss-color.png */ \"./src/assets/images/strauss-color.png\"),\n  descript: \"Richard Georg Strauss (1864 — 1949) was a German composer, conductor, pianist, and violinist. Considered a leading composer of the late Romantic and early modern eras, he has been described as a successor of Richard Wagner and Franz Liszt. Along with Gustav Mahler, he represents the late flowering of German Romanticism, in which pioneering subtleties of orchestration are combined with an advanced harmonic style.\",\n  descriptRU: \"Рихард Штраус (1864 — 1949) — немецкий композитор эпохи позднего романтизма, яркий представитель немецкого экспрессионизма, особенно прославился благодаря своим симфоническим поэмам и операм. Был также выдающимся дирижёром. Рихард Штраус и Густав Малер вместе представляют собой образец стиля позднего немецкого романтизма после Рихарда Вагнера.\"\n}, {\n  name: \"glinka\",\n  nameRU: \"глинка\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/glinka.mp3 */ \"./src/assets/sounds/glinka.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/glinka.png */ \"./src/assets/images/glinka.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/glinka-color.png */ \"./src/assets/images/glinka-color.png\"),\n  descript: \"Mikhail Ivanovich Glinka (1804 — 1857) was the first Russian composer to gain wide recognition within his own country and is often regarded as the fountainhead of Russian classical music. His compositions were an important influence on Russian composers, notably the members of The Five, who produced a distinctive Russian style of music.\",\n  descriptRU: \"Михаил Иванович Глинка (1804 — 1857) — русский композитор. Сочинения Глинки оказали влияние на крупнейших русских композиторов — А. С. Даргомыжского, М. П. Мусоргского, Н. А. Римского-Корсакова, А. П. Бородина, П. И. Чайковского и других. По выражению В. В. Стасова, «оба [Пушкин и Глинка] создали новый русский язык — один в поэзии, другой в музыке».\"\n}, {\n  name: \"chopin\",\n  nameRU: \"шопен\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/chopin.mp3 */ \"./src/assets/sounds/chopin.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/chopin.png */ \"./src/assets/images/chopin.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/chopin-color.png */ \"./src/assets/images/chopin-color.png\"),\n  descript: \"Frederic François Chopin (1810 – 1849) was a Polish composer and virtuoso pianist of the Romantic period, who wrote primarily for solo piano. He has maintained worldwide renown as a leading musician of his era, one whose \\\"poetic genius was based on a professional technique that was without equal in his generation\\\".\",\n  descriptRU: \"Фридерик Шопен (1810 - 1849) — польский композитор и пианист французско-польского происхождения. В зрелые годы (с 1831 года) жил и работал во Франции. Один из ведущих представителей западноевропейского музыкального романтизма, основоположник польской национальной композиторской школы. Оказал значительное влияние на мировую музыку.\"\n}, {\n  name: \"mendelssohn\",\n  nameRU: \"мендельсон\",\n  // TODO maibe change\n  mp3: __webpack_require__(/*! ./../../assets/sounds/mendelssohn.mp3 */ \"./src/assets/sounds/mendelssohn.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/mendelssohn.png */ \"./src/assets/images/mendelssohn.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/mendelssohn-color.png */ \"./src/assets/images/mendelssohn-color.png\"),\n  descript: \"Jakob Ludwig Felix Mendelssohn Bartholdy (1809 – 1847), born and widely known as Felix Mendelssohn, was a German composer, pianist, organist and conductor of the early Romantic period. Mendelssohn's compositions include symphonies, concertos, piano music, organ music and chamber music. His best-known works include the overture and incidental music for A Midsummer Night's Dream (which includes his \\\"Wedding March\\\"), the Italian Symphony, the Scottish Symphony, the oratorio St. Paul, the oratorio Elijah, the overture The Hebrides, the mature Violin Concerto and the String Octet. The melody for the Christmas carol \\\"Hark! The Herald Angels Sing\\\" is also his. Mendelssohn's Songs Without Words are his most famous solo piano compositions.\",\n  descriptRU: \"Якоб Людвиг Феликс Мендельсон Бартольди (1809 – 1847) — немецкий композитор, пианист, дирижёр, педагог еврейского происхождения. Именно его марш звучит во время бракосочетаний в России. Один из крупнейших представителей романтизма в музыке. Глава Лейпцигской школы в немецкой музыке, основатель Лейпцигской консерватории, внук философа Мозеса Мендельсона.\"\n}],\n// third\n[{\n  name: \"liszt\",\n  nameRU: \"лист\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/liszt.mp3 */ \"./src/assets/sounds/liszt.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/liszt.png */ \"./src/assets/images/liszt.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/liszt-color.png */ \"./src/assets/images/liszt-color.png\"),\n  descript: \"Franz Liszt (1811 – 1886) was a Hungarian composer, pianist and teacher of the Romantic period. With a diverse body of work spanning more than six decades, he is considered to be one of the most prolific and influential composers of his era and remains one of the most popular composers in modern concert piano repertoire.\",\n  descriptRU: \"Ференц Лист (1811 — 1886) — венгро-немецкий композитор, пианист, педагог, дирижёр, публицист, крупный представитель музыкального романтизма. Лист был одним из величайших пианистов XIX века. Его эпоха была расцветом концертного пианизма, Лист был в авангарде этого процесса, имея безграничные технические возможности. До сих пор его виртуозность остаётся ориентиром для современных пианистов, а произведения — вершинами фортепианной виртуозности.\"\n}, {\n  name: \"verdi\",\n  nameRU: \"верди\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/verdi.mp3 */ \"./src/assets/sounds/verdi.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/verdi.png */ \"./src/assets/images/verdi.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/verdi-color.png */ \"./src/assets/images/verdi-color.png\"),\n  descript: \"Giuseppe Fortunino Francesco Verdi (1813 – 1901) was an Italian composer best known for his operas. He was born near Busseto to a provincial family of moderate means, receiving a musical education with the help of a local patron. Verdi came to dominate the Italian opera scene after the era of Gioachino Rossini, Gaetano Donizetti, and Vincenzo Bellini, whose works significantly influenced him.\",\n  descriptRU: \"Джузеппе Фортунино Франческо Верди (1813 — 1883) — итальянский композитор. Его творчество является одним из величайших достижений мирового оперного искусства и кульминацией развития итальянской оперы XIX века. Им созданы 26 опер, реквием, струнный квартет и ряд духовных пьес. Лучшие оперы композитора: «Бал-маскарад», «Риголетто», «Трубадур», «Травиата». Вершина творчества — последние оперы: «Аида», «Отелло», «Фальстаф».\"\n}, {\n  name: \"brahms\",\n  nameRU: \"брамс\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/brahms.mp3 */ \"./src/assets/sounds/brahms.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/brahms.png */ \"./src/assets/images/brahms.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/brahms-color.png */ \"./src/assets/images/brahms-color.png\"),\n  descript: \"Johannes Brahms (1833 – 1897) was a German composer, pianist, and conductor of the mid-Romantic period. Born in Hamburg into a Lutheran family, he spent much of his professional life in Vienna. He is sometimes grouped with Johann Sebastian Bach and Ludwig van Beethoven as one of the \\\"Three Bs\\\" of music, a comment originally made by the nineteenth-century conductor Hans von Bülow. Brahms composed for symphony orchestra, chamber ensembles, piano, organ, violin, voice, and chorus. A virtuoso pianist, he premiered many of his own works. He worked with leading performers of his time, including the pianist Clara Schumann and the violinist Joseph Joachim (the three were close friends). Many of his works have become staples of the modern concert repertoire.\",\n  descriptRU: \"Иоганнес Брамс (1833 — 1897) — немецкий композитор и пианист, один из центральных представителей эпохи романтизма. В Гамбурге действует музей Брамса, в экспозиции которого представлены документы о жизни и творчестве Иоганнеса Брамса, оригиналы партитур его произведений. Музей размещается в нескольких помещениях приюта Байлинга, поскольку дом, в котором родился композитор, был разрушен в годы 2-й мировой войны.\"\n}, {\n  name: \"mussorgsky\",\n  nameRU: \"мусоргский\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/mussorgsky.mp3 */ \"./src/assets/sounds/mussorgsky.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/mussorgsky.png */ \"./src/assets/images/mussorgsky.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/mussorgsky-color.png */ \"./src/assets/images/mussorgsky-color.png\"),\n  descript: \"Modest Petrovich Mussorgsky (1839 – 1881) was a Russian composer, one of the group known as \\\"The Five\\\". He was an innovator of Russian music in the Romantic period. He strove to achieve a uniquely Russian musical identity, often in deliberate defiance of the established conventions of Western music. Many of his works were inspired by Russian history, Russian folklore, and other national themes. Such works include the opera Boris Godunov, the orchestral tone poem Night on Bald Mountain and the piano suite Pictures at an Exhibition.\",\n  descriptRU: \"Модест Петрович Мусоргский (1839 — 1881) — русский композитор, член «Могучей кучки». Работал в различных жанрах: в его творческом наследии — оперы, оркестровые пьесы, циклы вокальной и фортепианной музыки, романсы и песни, хоры. В творчестве Мусоргского нашли оригинальное и яркое выражение русские национальные черты, но самобытность его при жизни не была в полной мере оценена. С начала XX века и поныне его оперы «Борис Годунов» и «Хованщина», цикл фортепианных миниатюр «Картинки с выставки», вокальные циклы «Песни и пляски смерти», «Детская» признаются шедеврами мирового музыкального искусства.\"\n}, {\n  name: \"chaikovsky\",\n  nameRU: \"чайковский\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/chaikovsky.mp3 */ \"./src/assets/sounds/chaikovsky.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/chaikovsky.png */ \"./src/assets/images/chaikovsky.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/chaikovsky-color.png */ \"./src/assets/images/chaikovsky-color.png\"),\n  descript: \"Pyotr Ilyich Tchaikovsky (1840 — 1893) was a Russian composer of the Romantic period. He was the first Russian composer whose music would make a lasting impression internationally. He wrote some of the most popular concert and theatrical music in the current classical repertoire, including the ballets Swan Lake and The Nutcracker, the 1812 Overture, his First Piano Concerto, Violin Concerto, the Romeo and Juliet Overture-Fantasy, several symphonies, and the opera Eugene Onegin.\",\n  descriptRU: \"Пётр Ильич Чайковский (1840 — 1893) — русский композитор, педагог, дирижёр и музыкальный критик. Как композитор-профессионал Чайковский сформировался в 1860—1870 годы, ознаменованные большим подъёмом общественной и культурной жизни Российской империи: многогранным развитием русской музыки, литературы и живописи, расцветом отечественного естествознания, ярких завоеваний в области философии и эстетики.\"\n}, {\n  name: \"rimsky-korsakov\",\n  nameRU: \"римский-корсаков\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/rimsky-korsakov.mp3 */ \"./src/assets/sounds/rimsky-korsakov.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/rimsky-korsakov.png */ \"./src/assets/images/rimsky-korsakov.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/rimsky-korsakov-color.png */ \"./src/assets/images/rimsky-korsakov-color.png\"),\n  descript: \"Nikolai Andreyevich Rimsky-Korsakov (1844 — 1908) was a Russian composer, a member of the group of composers known as The Five. He was a master of orchestration. His best-known orchestral compositions—Capriccio Espagnol, the Russian Easter Festival Overture, and the symphonic suite Scheherazade—are staples of the classical music repertoire, along with suites and excerpts from some of his 15 operas. Scheherazade is an example of his frequent use of fairy-tale and folk subjects.\",\n  descriptRU: \"Николай Андреевич Римский-Корсаков (1844 — 1908) — русский композитор, педагог, дирижёр, общественный деятель, музыкальный критик; участник «Могучей кучки». Среди его сочинений — 15 опер, 3 симфонии, симфонические произведения, инструментальные концерты, кантаты, камерно-инструментальная, вокальная и духовная музыка.\"\n}],\n// fourth\n[{\n  name: \"grieg\",\n  nameRU: \"григ\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/grieg.mp3 */ \"./src/assets/sounds/grieg.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/grieg.png */ \"./src/assets/images/grieg.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/grieg-color.png */ \"./src/assets/images/grieg-color.png\"),\n  descript: \"Edvard Hagerup Grieg (1843 – 1907) was a Norwegian composer and pianist. He is widely considered one of the main Romantic era composers, and his music is part of the standard classical repertoire worldwide. His use of Norwegian folk music in his own compositions brought the music of Norway to fame, as well as helping to develop a national identity, much as Jean Sibelius did in Finland and Bedřich Smetana in Bohemia.\",\n  descriptRU: \"Эдвард Хагеруп Григ (1843 – 1907) — норвежский композитор, пианист, дирижёр, общественный деятель. Григ, творчество которого в целом относят к музыкальному романтизму, испытал значительное влияние норвежской народной культуры (эпоса, музыки, танца, современных бытовых традиций). Среди наиболее часто исполняемых произведений Грига — две сюиты из музыки к драме Генрика Ибсена «Пер Гюнт», Концерт для фортепиано с оркестром, фортепианные миниатюры из сборников «Лирические пьесы» (10 тетрадей), песни «Лебедь» (En svane), «Избушка» (Hytten), «Люблю тебя!» (Jeg elsker dig!), «Сердце поэта» (Du fatter ei Bølgernes evige Gang).\"\n}, {\n  name: \"schnittke\",\n  nameRU: \"шнитке\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/schnittke.mp3 */ \"./src/assets/sounds/schnittke.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/schnittke.png */ \"./src/assets/images/schnittke.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/schnittke-color.png */ \"./src/assets/images/schnittke-color.png\"),\n  descript: \"Alfred Garrievich Schnittke (1934 – 1998) was a Russian composer of Jewish-German descent. Among the most performed and recorded composers of late 20th-century classical music, he is described by musicologist Ivan Moody as a \\\"composer who was concerned in his music to depict the moral and spiritual struggles of contemporary man in depth and detail.\\\"\",\n  descriptRU: \"Альфред Гарриевич Шнитке (1934 — 1998) — советский и российский композитор, музыкальный педагог и музыковед. Заслуженный деятель искусств РСФСР (1987). Лауреат Государственной премии РСФСР имени Н. К. Крупской (1986), Государственной премии Российской Федерации (1995). Автор четырёх опер, трёх балетов, 10 симфоний, 15 инструментальных концертов, многочисленных произведений камерной, вокальной, хоровой и инструментальной музыки, музыки к кинофильмам, мультфильмам и театральным постановкам.\"\n}, {\n  name: \"rachmaninoff\",\n  nameRU: \"рахманинов\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/rachmaninoff.mp3 */ \"./src/assets/sounds/rachmaninoff.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/rachmaninoff.png */ \"./src/assets/images/rachmaninoff.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/rachmaninoff-color.png */ \"./src/assets/images/rachmaninoff-color.png\"),\n  descript: \"Sergei Vasilyevich Rachmaninoff (1873 — 1943) was a Russian composer, virtuoso pianist, and conductor. Rachmaninoff is widely considered one of the finest pianists of his day and, as a composer, one of the last great representatives of Romanticism in Russian classical music. Early influences of Tchaikovsky, Rimsky-Korsakov, and other Russian composers gave way to a thoroughly personal idiom notable for its song-like melodicism, expressiveness and rich orchestral colours. The piano is featured prominently in Rachmaninoff's compositional output and he made a point of using his skills as a performer to fully explore the expressive and technical possibilities of the instrument.\",\n  descriptRU: \"Сергей Васильевич Рахманинов (1873 — 1943) — русский композитор, пианист, дирижёр. Синтезировал в своём творчестве принципы петербургской и московской композиторских школ (а также смешение традиций западноевропейской и ближневосточной музыки) и создал свой оригинальный стиль. В творчестве Рахманинова как верующего человека прослеживаются христианские мотивы: Литургия св. Иоанна Златоуста (1910), Всенощная (1915). Рахманинов не только сделал выдающийся вклад в развитие русской духовной музыки, но и в прочих своих произведениях воплотил христианские идеи и символику.\"\n}, {\n  name: \"prokofiev\",\n  nameRU: \"прокофьев\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/prokofiev.mp3 */ \"./src/assets/sounds/prokofiev.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/prokofiev.png */ \"./src/assets/images/prokofiev.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/prokofiev-color.png */ \"./src/assets/images/prokofiev-color.png\"),\n  descript: \"Sergei Sergeyevich Prokofiev (1891 — 1953) was a Russian composer, pianist, and conductor who later worked in the Soviet Union. As the creator of acknowledged masterpieces across numerous music genres, he is regarded as one of the major composers of the 20th century. His works include such widely heard pieces as the March from The Love for Three Oranges, the suite Lieutenant Kijé, the ballet Romeo and Juliet—from which \\\"Dance of the Knights\\\" is taken—and Peter and the Wolf. Of the established forms and genres in which he worked, he created—excluding juvenilia—seven completed operas, seven symphonies, eight ballets, five piano concertos, two violin concertos, a cello concerto, a symphony-concerto for cello and orchestra, and nine completed piano sonatas.\",\n  descriptRU: \"Сергей Сергеевич Прокофьев (1891 — 1953) — русский и советский композитор, пианист, дирижёр, музыкальный писатель, шахматист первой категории. Народный артист РСФСР (1947). Лауреат Ленинской премии (1957) и шести Сталинских премий (1943, 1946 — трижды, 1947, 1952). Прокофьев писал во всех современных ему жанрах. Его перу принадлежат 8 опер, 8 балетов (7 балетов. \\\"Трапеция\\\" часто не упоминается, так как балет был задуман как инструментальное произведение) 7 симфоний и другие оркестровые сочинения, 9 концертов для сольного инструмента с оркестром, 9 фортепианных сонат, оратории и кантаты, камерные вокальные и инструментальные сочинения, музыка для кино и театра.\"\n}, {\n  name: \"khachaturian\",\n  nameRU: \"хачатурян\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/khachaturian.mp3 */ \"./src/assets/sounds/khachaturian.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/khachaturian.png */ \"./src/assets/images/khachaturian.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/khachaturian-color.png */ \"./src/assets/images/khachaturian-color.png\"),\n  descript: \"Aram Ilyich Khachaturian (1903 — 1978) was a Soviet and Armenian composer and conductor. He is considered one of the leading Soviet composers. Born and raised in Tbilisi, the multicultural capital of Georgia, Khachaturian moved to Moscow in 1921 following the Sovietization of the Caucasus. Without prior music training, he enrolled in the Gnessin Musical Institute, subsequently studying at the Moscow Conservatory in the class of Nikolai Myaskovsky, among others. His first major work, the Piano Concerto (1936), popularized his name within and outside the Soviet Union. It was followed by the Violin Concerto (1940) and the Cello Concerto (1946). His other significant compositions include the Masquerade Suite (1941), the Anthem of the Armenian SSR (1944), three symphonies (1935, 1943, 1947), and around 25 film scores. Khachaturian is best known for his ballet music—Gayane (1942) and Spartacus (1954). His most popular piece, the \\\"Sabre Dance\\\" from Gayane, has been used extensively in popular culture and has been performed by a number of musicians worldwide. His style is \\\"characterized by colorful harmonies, captivating rhythms, virtuosity, improvisations, and sensuous melodies\\\".\",\n  descriptRU: \"Арам Ильич Хачатурян (1903 — 1978) — армянский советский композитор, дирижёр, педагог, музыкально-общественный деятель. Автор трёх балетов, трёх симфоний, шести концертов, произведений вокальной, хоровой, инструментальной и программной музыки, музыки к кинофильмам и театральным постановкам, а также музыки Государственного гимна Армянской ССР (1944).\"\n}, {\n  name: \"shostakovich\",\n  nameRU: \"шостакович\",\n  mp3: __webpack_require__(/*! ./../../assets/sounds/shostakovich.mp3 */ \"./src/assets/sounds/shostakovich.mp3\"),\n  png: __webpack_require__(/*! ./../../assets/images/shostakovich.png */ \"./src/assets/images/shostakovich.png\"),\n  pngColor: __webpack_require__(/*! ./../../assets/images/shostakovich-color.png */ \"./src/assets/images/shostakovich-color.png\"),\n  descript: \"Dmitri Dmitriyevich Shostakovich (1906 — 1975) was a Soviet-era Russian composer and pianist who became internationally known after the premiere of his First Symphony in 1926 and was regarded throughout his life as a major composer. Shostakovich achieved early fame in the Soviet Union, but had a complex relationship with its government. His 1934 opera Lady Macbeth of Mtsensk was initially a success, but eventually was condemned by the Soviet government, putting his career at risk. In 1948 his work was denounced under the Zhdanov Doctrine, with professional consequences lasting several years. Even after his censure was rescinded in 1956, performances of his music were occasionally subject to state interventions, as with his Thirteenth Symphony (1962). Shostakovich was a member of the Supreme Soviet of the RSFSR (1947) and the Supreme Soviet of the Soviet Union (from 1962 until his death), as well as chairman of the RSFSR Union of Composers (1960–1968). Over the course of his career, he earned several important awards, including the Order of Lenin, from the Soviet government.\",\n  descriptRU: \"Дмитрий Дмитриевич Шостакович (1906 — 1975) — советский композитор, пианист, педагог, музыкально-общественный деятель. Народный артист СССР (1954), Герой Социалистического Труда (1966). Лауреат Ленинской премии (1958), пяти Сталинских премий (1941, 1942, 1946, 1950, 1952), Государственной премии СССР (1968), Государственной премии РСФСР имени М. И. Глинки (1974), а также номинант на премию «Оскар» за написание музыки к фильму «Хованщина». Один из крупнейших композиторов XX века, автор 15 симфоний и 15 квартетов, 6 концертов, 3 опер, 3 балетов, многочисленных произведений камерной музыки, музыки для кинофильмов и театральных постановок.\"\n}]];\n/* harmony default export */ const __WEBPACK_DEFAULT_EXPORT__ = (instruments);\n\n//# sourceURL=webpack://songbird/./src/pages/quiz-page/quiz-data.js?");

